import React, {useState} from 'react'
import {DropdownButton, Dropdown} from 'react-bootstrap'

function KeyRequest() {

    const [dropdownValue, setDropdownValue] = useState('');
    const handleSelect = (e) => {
        setDropdownValue(e);
        console.log(dropdownValue);
    }
    
    return (
        <div>
            <DropdownButton
                id="dropdown-button-dark-example2"
                variant="secondary"
                menuVariant="dark"
                title="Key dropdown button"
                className="mt-2"
                onSelect={handleSelect}
            >
                <Dropdown.Item eventKey="option-1" active>DUKPT</Dropdown.Item>
                <Dropdown.Item eventKey="option-2">Master - Session Key</Dropdown.Item>
                <Dropdown.Item eventKey="option-3">AES</Dropdown.Item>
                <Dropdown.Item eventKey="option-4">RSA Keys</Dropdown.Item>
            </DropdownButton>
        </div>
    )
}

export default KeyRequest;
